import * as React from 'react';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';
import './AboutMeCard.css'

const
    AboutMeCard = (props) => {

        if(
            props.right
        ){
            return (
                <Container className='aboutMeSection' maxWidth={false}>
                    <Typography variant='h4' >
                        {props.title}
                    </Typography>
                    <div class ="aboutMeFlex">
                        <Typography paragraph={true}>{props.paragraph}</Typography>
                        <img src={props.img} alt={props.imgAlt} ></img>
                    </div>
                </Container>
            )
        }
        else {
            return (
                <Container className='aboutMeSection' maxWidth={false}>
                    <Typography variant='h4' >
                        {props.title}
                    </Typography>
                    <div class ="aboutMeFlex">
                        <img src={props.img} alt={props.imgAlt} ></img>
                        <Typography paragraph={true}>{props.paragraph}</Typography>
                    </div>
                </Container>
            )
        }
    }

    /*
I was born and raised here in Calgary, and currently I'm a student at the University of Calgary where I am studying software Engineering. 
                    This summer I wanted to spend some time learning new languages and experimenting with developing some apps. You can find some of my projects below!
                    When I'm not learning new things or working, I like to spend my time learning Japanese, playing hockey, working out, working on my car, and playing around with linux.
    */
export {
    AboutMeCard
}
